const Download = () => {
    return ( <div className="flex">
        <div>
            <h2>Download Our Mobile App And Start Enjoying Smooth And Easy Transactions</h2>
            <p>Get our mobile on playstore or apple store and start enjoying smooth eNaira transactions</p>
            <div className="flex">
                <button>Download on Google Playstore</button>
                <button>Download on Apple Store</button>
            </div>
        </div>
    </div> );
}

export default Download;
